from pybricks.parameters import Direction, Port
from pybricks.pupdevices import Motor
from pybricks.robotics import DriveBase

# Set up all devices.
right = Motor(Port.A, Direction.CLOCKWISE)
left = Motor(Port.B, Direction.COUNTERCLOCKWISE)
drive_base = DriveBase(left, right, 81.4, 101.7182)


# The main program starts here.
# left wheel on second thick line,second thin line from corner on right
drive_base.use_gyro(True)
drive_base.settings(straight_speed=600)
drive_base.settings(turn_rate=300)
drive_base.curve(250, 90)
drive_base.straight(175)
drive_base.turn(35)
drive_base.settings(straight_speed=90)
drive_base.straight(245)
# Finish feeding whale
drive_base.settings(straight_speed=400)
drive_base.straight(-200)
drive_base.turn(60)
drive_base.straight(-500)
